import {FETCH_PRODUCTS} from "../action-types";
// import usersData from '../../api/usersData';
import axios from 'axios';

export const fetchProducts = (type, item) => async dispatch => {
    const response = await axios({
        method:'get',
        url:'https://cors-anywhere.herokuapp.com/https://noctem-a60b5.firebaseio.com/',
        headers:{'origin':"https://noctem-a60b5.firebaseio.com/"}
    })
    console.log(response)
    dispatch({
        type: FETCH_PRODUCTS,
        payload: response.data[type][item]
    })
};
